import styled from "styled-components";

const StyledWrapper = styled.div`
  width: 100%;
  background: black;

  @media only screen and (min-width:600px){
    margin:0 auto;
    width:500px;
  }
`;

const Wrapper = () => {
  return (
    <StyledWrapper>

    </StyledWrapper>
  )
}
